import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import { useAuthr } from '../Login/peticion';


function Profile(){
    const auth=useAuthr();
    console.log("un profile",auth.user)
    function lectura(e){
        console.log(e.target)
    }
    return(
    <Container>
        <Row>
            <Col>
            <ul class="list-group w-50">
            <li onClick={lectura} name="information" class="list-group-item bg-dark text-light active">Information</li>
            <li class="list-group-item bg-dark text-light" >Change password</li>
            <li class="list-group-item bg-dark text-light">Delete courses</li>  
            <li class="list-group-item bg-dark text-light">Drop out</li>
            <li class="list-group-item bg-dark text-light">Logout</li>
          
            </ul>
            </Col>

            <Col>
            <h2>Lado b </h2>
            </Col>
        </Row>
    </Container>
    )
}

export {Profile}
